import { Box, Heading } from "@chakra-ui/react";
import axios from "axios";
import { useEffect, useState } from "react";
import { CharCard } from "../CharCard";
export const List = () => {
  const [characterList, setCharacterList] = useState([]);
  const [link, setLink] = useState("https://rickandmortyapi.com/api/character");
  const [previousLInk, setPreviousLink] = useState(null);

  useEffect(() => {
    axios.get(link).then(async (response) => {
      await setCharacterList(response.data.result);
    });
  }, [characterList, link]);

  return (
    <>
      <Box>
        <Heading>Oi</Heading>

        {characterList.map((character) => (
          <CharCard character={character} />
        ))}
      </Box>
    </>
  );
};
